import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { ICON_NAME } from "react-icons/fa";

import "./styles.css";

export default function Footer() {
  return (
    <Container fluid>
      <Row>
        <Col sm>
            <div className="small-card-content">

            </div>
        </Col>
        <Col sm>
            <div className="big-card-content">

            </div>
        </Col>
      </Row>
    </Container>
  );
}
